import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class UsersGroupNameService {
  private groupName: string = 'Study Space';

  getGroupName(): string {
    return this.groupName;
  }

  setGroupName(newName: string): void {
    this.groupName = newName;
  }
}
